import Landing from "../img/landing1.svg"
function Index() {

    return (
        <div className="landingImg">
            <div className="row d-flex allBody landingImg"
                style={{ backgroundImage: `url(${Landing})`, backgroundPosition: "center", backgroundSize: "cover", backgroundRepeat: "no-repeat", height: "80vh " }}
            >
                {/* <img src="/landing.jpg" alt="Landing" className="landingImg" /> */}
            </div>
        </div>
    )
}

export default Index
